import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import { useState } from 'react';

function App() {

  const[precios, agregarPrecio] = useState(
    [
      {id:1, nombre: "1/4", precio: 1000 },
      {},
    ]
  );

  return (
    <div>
      <Header/>
      <h1 className='text-center'>Helados Hurlingham</h1>
      {
        precios.map(precio => (
          <p> {precio.nombre} | {precio.precio}</p>
        ))
      }
      <Footer/>
    </div>
  );
}

export default App;
